import Router from '@/router.js'
import { apiService } from '../services/api.js'

export default {
  name: 'register',
  components: {},
  data() {
    return {
      email: "",
      password: "",
    }
  },
  methods:{
    onSubmit() {
      apiService.register({
        email: this.email, password: this.password,
      }).then((res) => {
        Router.push({ path: '/login' })
      }).catch((error) => {
        console.log(error)
        alert(error.response.data.message)
      })

      return false
    }
  }
}
